@media screen and (max-width: 991px) {
  #hamburgerLabel {
    display: block;
    position: fixed;
    top: 1em;
    right: 1em;
    z-index: 2;
    background: rgba(0, 0, 0, 0.2);
    padding: 1em;
    font-size: 1em;
    color: white;
    font-family: "source sans pro", helvetica, sans-serif;
    letter-spacing: 0.04rem;
  }
  #hamburgerLabel::before {
    color: white;
    content: "";
    font-family: "Font Awesome 5 Free";
    font-weight: 900;
    margin-right: 0.7em;
  }
  #hamburgerLabel::after {
    content: "MENU";
  }

  #hamburgerCheckbox {
    display: none;
  }
  #hamburgerCheckbox ~ nav {
    position: fixed;
    top: 0;
    right: 0;
    z-index: 1;
    transform: translateX(100%);
    transition: all 500ms ease-out;
  }
  #hamburgerCheckbox:checked ~ nav {
    position: fixed;
    top: 0;
    right: 0;
    z-index: 1;
    background: white;
    height: 100%;
    width: 250px;
    display: flex;
    flex-flow: column wrap;
    justify-content: flex-start;
    transform: translateX(0);
  }
  #hamburgerCheckbox:checked ~ nav > ul.nav_pages {
    display: flex;
    flex-flow: column wrap;
    margin: 5em 2em 1em 2em;
  }
  #hamburgerCheckbox:checked ~ nav > ul.nav_pages > li:not(:last-child) {
    border-bottom: 2px solid #eae6e6;
  }
  #hamburgerCheckbox:checked ~ nav > ul.nav_socialIcons {
    margin: 1em 1em 0 1.5em;
  }
  #hamburgerCheckbox:checked ~ nav > ul > li a {
    color: #212931;
  }
  #hamburgerCheckbox:checked ~ nav > ul > li a:hover {
    color: #18BFEF;
  }
  #hamburgerCheckbox:checked ~ nav > ul > li i {
    font-size: 12px;
    border: 2px solid #eae6e6;
    border-radius: 50%;
    padding: 0.5em;
  }
  #hamburgerCheckbox:checked ~ nav > ul > li i.fa-facebook-f {
    padding: 0.6em 0.8em;
  }
  #hamburgerCheckbox:checked ~ nav > ul > li i:hover {
    border: 2px solid #18BFEF;
  }
  #hamburgerCheckbox:checked + #hamburgerLabel {
    background: none;
  }
  #hamburgerCheckbox:checked + #hamburgerLabel::after {
    display: none;
  }
  #hamburgerCheckbox:checked + #hamburgerLabel::before {
    content: "";
    color: #212931;
  }

  nav {
    display: none;
  }
}
@media screen and (min-width: 992px) {
  #hamburgerCheckbox, #hamburgerLabel {
    display: none;
  }
}
