@import url('https://fonts.googleapis.com/css2?family=Source+Sans+Pro:wght@900&display=swap');


// TYPOGRAPHY's VARIABLES 
//-------------------------------
    // TEXT
        $font_text: 'merriweather', georgia, serif;
        $font_size_text: .8rem;
        $font_weight_text: 300;
        $line_height_text: 2.4em;


    // TITLES

        $font_size_h1: 3rem;
        $letter_spacing_h1: .2rem;

        $font_size_h2: 1.4rem;
        $letter_spacing_h2: .04rem;

        $font_size_h3: 1rem;
        $letter_spacing_h3: .04rem;

        $font_size_h4: .8rem;
        $letter_spacing_h4: .04rem;

        $font_size_h5: .7rem;
        $letter_spacing_h5: .04rem;

        $font_size_h6: .6rem;
        $letter_spacing_h6: .04rem;


    // TITLES IN COMMON
        $font_title: 'source sans pro', helvetica, sans-serif;
        $font_weight_title: 900;


    //TEXT AND TITLES IN COMMON
        $font_color: $color_font;
