// MENU HAMBURGER !!
//-------------------------------



@media screen and (max-width: 991px) {
    #hamburgerLabel {
        display: block;
        position: fixed;
        top: 1em; right: 1em;
        z-index: 2;
        background: rgba($color: #000, $alpha: 0.2);
        padding: 1em;
        font-size: 1em;
        color: white;
        font-family: $font_title;
        letter-spacing: $letter_spacing_h2;
        &::before {
            color: white;
            content: '\f0c9';
            font-family: 'Font Awesome 5 Free';
            font-weight: 900;
            margin-right: .7em;
        }
        &::after {
            content: 'MENU';
        }
    }


    #hamburgerCheckbox {
        display: none; 
        ~ nav {
            position: fixed;
            top: 0; right: 0;
            z-index: 1;
            transform: translateX(100%);
            transition: all 500ms ease-out;
        }
        &:checked {
            ~ nav {
                position: fixed;
                top: 0; right: 0;
                z-index: 1;

                background: white;
                height: 100%;
                width: 250px;

                display: flex;
                flex-flow: column wrap;
                justify-content: flex-start;

                &> ul.nav_pages {
                    display: flex;
                    flex-flow: column wrap; 
                    margin: 5em 2em 1em 2em;
                    &> li:not(:last-child) {
                        border-bottom: 2px solid #eae6e6;
                    }
                }
                &> ul.nav_socialIcons {
                    margin: 1em 1em 0 1.5em;
                }

                &>ul > li {
                    & a {
                        color: $font_color;
                        &:hover {
                            color: $color_hover;
                        }
                    }
                    & i {
                        font-size: $icon_thin_size;
                        border: $icon_surrounded;
                        border-radius: $icon_surrounded_radius;
                        padding: $padding_icon_radius;
                        &.fa-facebook-f {
                            padding: .6em .8em;
                        }
                        &:hover {
                            border: 2px solid $color_hover;
                        }
                    }
                }
                transform: translateX(0);
            }
            + #hamburgerLabel {
                background: none;
                &::after {
                    display: none;
                }
                &::before {
                    content: '\f00d';
                    color: $font_color;
                }
            } 
        }
    }

    nav {
        display: none;
    }    
}

@media screen and (min-width: 992px) {
    #hamburgerCheckbox, #hamburgerLabel {
        display: none;
    }
}

